import React from "react";

function Phone() {
  return (
    <div>
      <p></p>
      <p>Technical details:</p>
      <ul>
        <li>Color: </li>
        <li>Screen: </li>
        <li>Processor: </li>


      </ul>
      "description": "iPhone 7 dramatically improves the most important aspects
      of the iPhone experience. It introduces advanced new camera systems. The
      best performance and battery life ever in an iPhone. Immersive stereo
      speakers. The brightest, most colorful iPhone display. Splash and water
      resistance*. And it looks every bit as powerful as it is. This is iPhone
      7.", "color": "black", "price": 769, "imageFileName": "IPhone_7.png",
      "screen": "4,7 inch IPS", "processor": "A10 Fusion", "ram": 2
    </div>
  );
}

export default Phone;
